const CREATE_MESSAGE = gql`
  mutation CreateMessage($input: CreateMessageInput!) {
    createMessage(input: $input) {
      id
    }
  }
`;

function MyForm() {
  const [createMessage, { loading, error }] = useMutation(CREATE_MESSAGE);

