    event.preventDefault();

    const formData = new FormData(event.target);
    const input = {
      name: formData.get('name'),
      email: formData.get('email'),
      message: formData.get('message'),
    };

    try {
      const result = await createMessage({ variables: { input } });
      console.log(`Message created with ID ${result.data.createMessage.id}`);
    } catch (err) {
      console.error(err);
    }
  }

  return (
    <form onSubmit={handleSubmit}>
      {/* ... */}
    </form>
  );
}
```
